import PickList from 'component/column/pickList';
import { VFC } from 'react';
import styled from "styled-components";
import { header } from 'const/size'

const RecordEntryForm: VFC = () => {
    console.log('★recordEntryForm★');

    const columns = [
        {
            label: '釣れた魚',
            select:{
                id: 'caughtFish',
                name: 'caughtFish'
            },
            options: [{
                    value: 'aji',
                    text: 'アジ',
                },
                {
                    value: 'buri',
                    text: 'ブリ',
                },
                {
                    value: 'kasago',
                    text: 'カサゴ',
                },
                {
                    value: 'tachiuo',
                    text: 'タチウオ',
                },
                {
                    value: 'haze',
                    text: 'ハゼ',
                }
        ],
        multiple: true,
        required: true,
        }
    ]

    return (
        <StyledWrapper>
            {columns.map((c)=>(
                <PickList label={c.label} select={c.select} options={c.options}></PickList>
            ))}
        </StyledWrapper>
    )
}

const StyledWrapper =styled.div`
    margin-top: ${header.height};
`;

export default RecordEntryForm;
